('cmc0132pr0022qoub6hnevd6b', 'cmbzzm6md001uqoub6s6hhnq6', 'THE MOST DANGEROUS HACKERS YOU''VE NEVER HEARD OF', 'THE MOST DANGEROUS HACKERS YOU''VE NEVER HEARD OF\\nA new article on Wired came out with this title, and I decided to tell you a little about them\\n\\n1. TraderTraitor üá∞üáµ North Korea\\n\\nThat very Bybit hack for almost $1.5 billion was their doing. TraderTraitor creates fake accounts (or uses real hacked ones) and literally tracks every step of the right employee in order to send a phishing letter in time. It is considered an A+ team in the DPRK\\n\\n2. Gamaredon and Black Basta üá∑üá∫ Russia\\n\\nGamaredon is much less technologically advanced (compared to the DPRK), but they win with quantity and 24/7 work.\\n\\nOne (!) computer is infected with 80-120 variants of malware in order to destroy the infrastructure\\n\\nBlack Basta is aimed at the West. Steal data > encrypt and threaten to leak > demand ransom\\n\\n(I didn''t hold a candle, but all these stories about hacking hospitals, when all the equipment there died, are attributed to them)\\n\\n3. CyberAv3ngers üáÆüá∑ Iran\\n\\nThey called themselves Hacktivists, but in addition to Jews, they terrorize American oil and gas companies and others. The US authorities promise 10 million dollars for information about them\\n\\n4. Brass Typhoon and Smishing Triad üá®üá≥ China\\n\\nBrass Typhoon attacks everything American - from the farmer''s application for cow milking (not a joke) to shipping and logistics\\n\\nAnd Taiwan too - source code and designs of microcircuits, power grids, and so on\\n\\nSmishing Triad act differently. Smishing is a mix of SMS and phishing emails, they pretend to be companies (post office, tax office, utility companies, etc.) and steal money', 'text', 'Tech', null, null, false, false, null, 'SOL', 3, 0, 0, '2025-06-17 04:33:41.248', '2025-06-17 13:22:48.427'),
