('cmc0b80gu003aqoub5gpgyu89', 'cmbzncu4a0000qon0l7102und', '17 june', 'üåø June 17 ‚Äî Mitrofan Navoznik (Folk Day in Russia)\\nOn this day, people cleaned barns and spread manure ‚Äî a tradition believed to bring a good harvest. Hence the nickname Navoznik ("Manure Man").\\n\\nFolk weather signs:\\nüåß Rain ‚Äì many mushrooms and berries ahead\\n‚òÄÔ∏è Dew in the morning ‚Äì expect a warm, clear day\\nüïä Swallows flying low ‚Äì rain is coming\\n\\nWhat to do:\\nClean the barn, tend the land, and avoid quarrels ‚Äî peace brings prosperity.\\n\\n#sfolkcalendar #Russiantraditions #June17 #weatherlore', 'image', 'Art', 'https://iwzfrnfemdeomowothhn.supabase.co/storage/v1/object/public/posts/images/1dc445614753be1e497a291fb06c4c41.png', 'https://iwzfrnfemdeomowothhn.supabase.co/storage/v1/object/public/posts/1dc445614753be1e497a291fb06c4c41.png', false, false, null, 'SOL', 8, 0, 0, '2025-06-17 09:17:27.774', '2025-06-17 16:41:55.153'),
